// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";

contract LaunchpadERC1155 is ERC1155, Ownable, Pausable, ERC2981 {
    string public name;
    string public symbol;
    uint256 public mintPrice;
    uint256 public maxSupply;
    uint256 public maxPerWallet;
    uint256 public mintStart;
    uint256 public mintEnd;
    bool public whitelistEnabled;
    mapping(address => bool) public whitelist;
    mapping(address => uint256) public mintedPerWallet;
    string private _contractURI;

    event Minted(address indexed minter, uint256 tokenId, uint256 amount);
    event FundsWithdrawn(address indexed to, uint256 amount);

    constructor(
        string memory name_,
        string memory symbol_,
        string memory uri_,
        uint256 mintPrice_,
        uint256 maxSupply_,
        uint256 maxPerWallet_,
        uint256 mintStart_,
        uint256 mintEnd_,
        address royaltyReceiver_,
        uint96 royaltyFeeNumerator_,
        bool whitelistEnabled_
    ) ERC1155(uri_) {
        name = name_;
        symbol = symbol_;
        mintPrice = mintPrice_;
        maxSupply = maxSupply_;
        maxPerWallet = maxPerWallet_;
        mintStart = mintStart_;
        mintEnd = mintEnd_;
        whitelistEnabled = whitelistEnabled_;
        if (royaltyReceiver_ != address(0) && royaltyFeeNumerator_ > 0) {
            _setDefaultRoyalty(royaltyReceiver_, royaltyFeeNumerator_);
        }
    }

    function setURI(string memory newuri) external onlyOwner {
        _setURI(newuri);
    }

    function setMintPrice(uint256 price) external onlyOwner {
        mintPrice = price;
    }

    function setMaxSupply(uint256 supply) external onlyOwner {
        maxSupply = supply;
    }

    function setMaxPerWallet(uint256 maxPer) external onlyOwner {
        maxPerWallet = maxPer;
    }

    function setMintWindow(uint256 start, uint256 end) external onlyOwner {
        mintStart = start;
        mintEnd = end;
    }

    function setWhitelistEnabled(bool enabled) external onlyOwner {
        whitelistEnabled = enabled;
    }

    function setWhitelist(address[] calldata addrs, bool enabled) external onlyOwner {
        for (uint256 i = 0; i < addrs.length; i++) {
            whitelist[addrs[i]] = enabled;
        }
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function withdraw(address payable to) external onlyOwner {
        uint256 bal = address(this).balance;
        require(bal > 0, "No funds");
        (bool sent, ) = to.call{value: bal}("");
        require(sent, "Withdraw failed");
        emit FundsWithdrawn(to, bal);
    }

    function mint(uint256 tokenId, uint256 amount) external payable whenNotPaused {
        require(block.timestamp >= mintStart, "Mint not started");
        require(mintEnd == 0 || block.timestamp <= mintEnd, "Mint ended");
        require(totalSupply(tokenId) + amount <= maxSupply, "Exceeds max supply");
        require(mintedPerWallet[msg.sender] + amount <= maxPerWallet, "Exceeds wallet limit");
        require(msg.value >= mintPrice * amount, "Insufficient payment");
        if (whitelistEnabled) {
            require(whitelist[msg.sender], "Not whitelisted");
        }
        _mint(msg.sender, tokenId, amount, "");
        mintedPerWallet[msg.sender] += amount;
        emit Minted(msg.sender, tokenId, amount);
    }

    function totalSupply(uint256 id) public view returns (uint256) {
        return super.balanceOf(address(this), id);
    }

    // EIP-2981
    function supportsInterface(bytes4 interfaceId) public view override(ERC1155, ERC2981) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

