// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";

contract LaunchpadERC721 is ERC721Enumerable, Ownable, Pausable, ERC2981 {
    string private _baseTokenURI;
    uint256 public mintPrice;
    uint256 public maxSupply;
    uint256 public maxPerWallet;
    uint256 public mintStart;
    uint256 public mintEnd;
    bool public whitelistEnabled;
    mapping(address => bool) public whitelist;
    mapping(address => uint256) public mintedPerWallet;

    event Minted(address indexed minter, uint256 tokenId);
    event FundsWithdrawn(address indexed to, uint256 amount);

    constructor(
        string memory name_,
        string memory symbol_,
        string memory baseTokenURI_,
        uint256 mintPrice_,
        uint256 maxSupply_,
        uint256 maxPerWallet_,
        uint256 mintStart_,
        uint256 mintEnd_,
        address royaltyReceiver_,
        uint96 royaltyFeeNumerator_,
        bool whitelistEnabled_
    ) ERC721(name_, symbol_) {
        _baseTokenURI = baseTokenURI_;
        mintPrice = mintPrice_;
        maxSupply = maxSupply_;
        maxPerWallet = maxPerWallet_;
        mintStart = mintStart_;
        mintEnd = mintEnd_;
        whitelistEnabled = whitelistEnabled_;
        if (royaltyReceiver_ != address(0) && royaltyFeeNumerator_ > 0) {
            _setDefaultRoyalty(royaltyReceiver_, royaltyFeeNumerator_);
        }
    }

    function setBaseURI(string memory uri) external onlyOwner {
        _baseTokenURI = uri;
    }

    function setMintPrice(uint256 price) external onlyOwner {
        mintPrice = price;
    }

    function setMaxSupply(uint256 supply) external onlyOwner {
        maxSupply = supply;
    }

    function setMaxPerWallet(uint256 maxPer) external onlyOwner {
        maxPerWallet = maxPer;
    }

    function setMintWindow(uint256 start, uint256 end) external onlyOwner {
        mintStart = start;
        mintEnd = end;
    }

    function setWhitelistEnabled(bool enabled) external onlyOwner {
        whitelistEnabled = enabled;
    }

    function setWhitelist(address[] calldata addrs, bool enabled) external onlyOwner {
        for (uint256 i = 0; i < addrs.length; i++) {
            whitelist[addrs[i]] = enabled;
        }
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function withdraw(address payable to) external onlyOwner {
        uint256 bal = address(this).balance;
        require(bal > 0, "No funds");
        (bool sent, ) = to.call{value: bal}("");
        require(sent, "Withdraw failed");
        emit FundsWithdrawn(to, bal);
    }

    function mint(uint256 quantity) external payable whenNotPaused {
        require(block.timestamp >= mintStart, "Mint not started");
        require(mintEnd == 0 || block.timestamp <= mintEnd, "Mint ended");
        require(totalSupply() + quantity <= maxSupply, "Exceeds max supply");
        require(mintedPerWallet[msg.sender] + quantity <= maxPerWallet, "Exceeds wallet limit");
        require(msg.value >= mintPrice * quantity, "Insufficient payment");
        if (whitelistEnabled) {
            require(whitelist[msg.sender], "Not whitelisted");
        }
        for (uint256 i = 0; i < quantity; i++) {
            uint256 tokenId = totalSupply() + 1;
            _safeMint(msg.sender, tokenId);
            emit Minted(msg.sender, tokenId);
        }
        mintedPerWallet[msg.sender] += quantity;
    }

    function _baseURI() internal view override returns (string memory) {
        return _baseTokenURI;
    }

    // EIP-2981
    function supportsInterface(bytes4 interfaceId) public view override(ERC721Enumerable, ERC2981) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

contracts/LaunchpadFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./LaunchpadERC721.sol";
import "./LaunchpadERC1155.sol";

contract LaunchpadFactory {
    address public owner;
    address public erc721Implementation;
    address public erc1155Implementation;

    event ERC721CollectionCreated(address indexed creator, address collection, string name, string symbol);
    event ERC1155CollectionCreated(address indexed creator, address collection, string name, string symbol);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    constructor(address _erc721Impl, address _erc1155Impl) {
        owner = msg.sender;
        erc721Implementation = _erc721Impl;
        erc1155Implementation = _erc1155Impl;
    }

    function setERC721Implementation(address impl) external onlyOwner {
        erc721Implementation = impl;
    }

    function setERC1155Implementation(address impl) external onlyOwner {
        erc1155Implementation = impl;
    }

    function createERC721Collection(
        string memory name_,
        string memory symbol_,
        string memory baseTokenURI_,
        uint256 mintPrice_,
        uint256 maxSupply_,
        uint256 maxPerWallet_,
        uint256 mintStart_,
        uint256 mintEnd_,
        address royaltyReceiver_,
        uint96 royaltyFeeNumerator_,
        bool whitelistEnabled_
    ) external returns (address) {
        LaunchpadERC721 collection = new LaunchpadERC721(
            name_,
            symbol_,
            baseTokenURI_,
            mintPrice_,
            maxSupply_,
            maxPerWallet_,
            mintStart_,
            mintEnd_,
            royaltyReceiver_,
            royaltyFeeNumerator_,
            whitelistEnabled_
        );
        collection.transferOwnership(msg.sender);
        emit ERC721CollectionCreated(msg.sender, address(collection), name_, symbol_);
        return address(collection);
    }

    function createERC1155Collection(
        string memory name_,
        string memory symbol_,
        string memory uri_,
        uint256 mintPrice_,
        uint256 maxSupply_,
        uint256 maxPerWallet_,
        uint256 mintStart_,
        uint256 mintEnd_,
        address royaltyReceiver_,
        uint96 royaltyFeeNumerator_,
        bool whitelistEnabled_
    ) external returns (address) {
        LaunchpadERC1155 collection = new LaunchpadERC1155(
            name_,
            symbol_,
            uri_,
            mintPrice_,
            maxSupply_,
            maxPerWallet_,
            mintStart_,
            mintEnd_,
            royaltyReceiver_,
            royaltyFeeNumerator_,
            whitelistEnabled_
        );
        collection.transferOwnership(msg.sender);
        emit ERC1155CollectionCreated(msg.sender, address(collection), name_, symbol_);
        return address(collection);
    }
}

